import React, {useState} from 'react';
import Header from "../../helpers/headers/Headers";
import TitleAndServices from "../../helpers/TitleAndServices";
import Calculation from "./Calculation";
import Paginate from "../../helpers/scroll/Paginate";

function Prices(props) {
    const paginate = new Paginate(4, useState(0))
    return (
        <>

            <div className="body global-margin">
                <TitleAndServices paginate={paginate} title="Вычеслить цену"/>
                <div style={{
                    marginTop: "2rem"
                }}/>
                <Calculation/>
            </div>
        </>

    );
}

export default Prices;
